import React, { useContext } from "react";
import "./App.css";
import Layout from "./Layout/Layout";
import Grocery from "./components/Grocery";
import Guzec from "../components/Guzec";

function App() {
  return (
    <div className="App">
      <Layout guzec={<Guzec />}>
        <Grocery />
      </Layout>
    </div>
  );
}

export default App;
